import React, { useState } from "react";
import axios from "axios";

function Upload() {
  const [name, setName] = useState("");
  const [file, setFile] = useState("");
  const [DataRecieved, setDataRecieved] = useState({});

  let submit = (e) => {

    e.preventDefault();
    let data = new FormData();
data.append('file', file, file.fileName);
    // console.log(email);
    // let Data = {
    //   name: name,
    //   file: file,
    // };
    // console.log(Data);
    axios.post("http://localhost:3001/timeline", data).then((response) => {
      console.log(response);
      setDataRecieved(response);
    });
    // console.log(pass);
  };
  console.log("This is ", DataRecieved.data);

  return (
    <div className="uploadform">
      <form>
        <h1>Upload Your Image</h1>
        <br></br>
        <br></br>
        <h4>
          Name: &nbsp;&nbsp;
          <input
            type="text"
            name="name"
            onChange={(evt) => {
              setName(evt.target.value);
            }}
          ></input>
        </h4>
        <br></br>
        <br></br>
        <h2>
          <input
            type="file"
            name="filename"
            onChange={(evt) => {
              setFile(evt.target.value);
            }}
          ></input>
        </h2>
        <br></br>
        <br></br>
        <input
          type="submit"
          defaultValue="Submit"
          value="Submit"
          onClick={submit}
          // onClick={submit}
        />
      </form>
    </div>
  );
}

export default Upload;
